import React, {useState} from "react";
import NavigationPriceCalculator from "./NavigationPriceCalculator";
// import { Container, Col, Row, Card } from "react-bootstrap";
// import { HouseFill, Cart4 } from "react-bootstrap-icons";

const PriceCalculator = () => {

  const [currentStep, setCurrentStep] = useState(0);

  const [question, setQuestion] = useState([]);

    useEffect(()=>{
        fetch("http://localhost/bachelor_exam/questions_fetch.php")
        .then(response => {
            return response.json()
        })
        .then((result)=>{
            // setQuestion(result);
            console.log(result);
        })
    }, []);

    const QuestionRow = ({question}) => (
        <div>
            <h1>{question.text}</h1>
            <h3>{question.description}</h3>
            </div>
    )

    const QuestionList = ({questions}) => (
        <div>
            {questions.map(question => <QuestionRow key={question.id} question={question} />)}
        </div>
    )

  return (
    <div>
      <NavigationPriceCalculator />
      <Questions />
      
    </div>
  );
};

export default PriceCalculator;
